import CardItem from "./CardItem";

const Cards = (props) => {
  return (
    <div>
      <CardItem
        title={props[0].title}
        image={props[0].image}
        description={props[0].description}
      />
      <CardItem
        title={props[1].title}
        image={props[1].image}
        description={props[1].description}
      />
      <CardItem
        title={props[2].title}
        image={props[2].image}
        description={props[2].description}
      />
    </div>
  );
};

export default Cards;
